import React, { useState, useEffect } from 'react';
import {
  faUser,
  faEnvelope,
  faGear,
  faMoon,
  faSignOutAlt,
} from '@fortawesome/free-solid-svg-icons';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faPenToSquare, faCircleUser } from '@fortawesome/free-solid-svg-icons';
import { BrowserRouter, Routes, Route, Navigate, useNavigate } from 'react-router-dom';
import Dashboard from './Dashboard';
// Assuming you have a profile image in the images folder

const Home = ({ setIsAuth }) => {
  const [darkMode, setDarkMode] = useState(false);
  const [showLogout, setShowLogout] = useState(false);
  const [username, setUsername] = useState('User'); // Replace with actual username logic
  const findUser = async () => {
  try{
    const response = await fetch(`http://localhost:5000/api/home=${user}`);
    const data = await response.json();
    setUsername(data.user);
  }
  catch (error) {
    console.error('Error', error);
  }

};
  const handleLogout = () => {
    localStorage.removeItem('token');
    setIsAuth(false);
    navigate('/');
  };
  const handleEditProfile = () => {
    navigate('/edit-profile');
  };
  const goToCompose = () => {
    navigate('/dashboard');
    <BrowserRouter>
      <Routes>
        <Route element={isAuth ? <Dashboard setIsAuth={setIsAuth} /> : <Navigate to="/" />}></Route> // or your /compose page if you have one
      </Routes>
    </BrowserRouter>
  };
  const navigate = useNavigate();
  return (
    <div className="min-h-screen bg-gray-100">
      <nav className="navbar">
        <span className="navbar-title">CursorMail</span>
        <div className="navbar-buttons">
          <div className="compose-button" onClick={goToCompose} title="Compose"><FontAwesomeIcon icon={faPenToSquare} /></div>
        </div>
        <div className={`profile-dropdown ${darkMode ? 'dark' : 'light'}`}>
      <div className="profile-info">
        {/* Profile Icon Button */}
        <FontAwesomeIcon
          className="avatar"
          icon={faCircleUser}
          size="2x"
          onClick={() => setShowLogout(!showLogout)}
          style={{ cursor: 'pointer' }}
        />

        {/* Dropdown Menu */}
        {showLogout && (
          <div className="logout-dropdown">
            <h4>{username}</h4>
              <option onClick={handleEditProfile}>
                <FontAwesomeIcon icon={faUser} />
                My Profile
              </option>
              <option>
                <FontAwesomeIcon icon={faGear} />
                Settings
              </option>
              <option onClick={() => setDarkMode(!darkMode)}>
                <FontAwesomeIcon icon={faMoon} />
                Switch to Dark
                <label className="switch">
                  <input
                    type="checkbox"
                    checked={darkMode}
                    onChange={() => setDarkMode(!darkMode)}
                  />
                  <span className="slider"></span>
                </label>
              </option>
              <option onClick={handleLogout}>
                <FontAwesomeIcon icon={faSignOutAlt} />
                Log Out
              </option>
          </div>
        )}
      </div>
    </div>
      </nav>

      <div className="search-bar">
        <input
          type="text"
          placeholder="Search..."
          className="search-input"
        />
        <button className="ml-2 px-4 py-2 bg-blue-600 text-white rounded-md">Search</button>
      </div>
    </div>
  );
};
export default Home;
